  false,\n\t\"url\": null,\n\t\"notes\": \"A large number of moorings were deployed
  in the summer of 2001 off Huntington Beach CA to monitor coastal ocean process that
  transport suspended material across the shelf. This program was supported by the
  Orange County Sanitation District (OCSD) to determine if bacteria from their ocean
  outfall was responsible for the continuing contamination of local beaches. The study
  determined that OSCD's outfall was not the cause of beach contamination.\",\n\t\"owner_org\":
